        //url
        this.checkUrl = function (content) {
            
            if (content && content.match(regUrl)) {
                content = content.replace(regUrl, function (char) {
                    return "<a target='_blank' href='" + (regPro.exec(char) ? char : ("http://" + char)) + "'>" + char + "</a>";
                });
            }
            return content;
        };
        
        //ip
        var replaceDownUrlIp = function (url) {
            
            if (regPro.test(url)) {
                var urlArr = url.split('/');
                
                urlArr.splice(0, 3);
                url = WebAgent.config.DOWN_FILE_URL + urlArr.join('/');  // ip+ip
            } else {
                url = WebAgent.config.DOWN_FILE_URL + url;
            }
            
            return url;
        };
        
        var formatTiming = function (timing) {
            if (timing < 60) {
                return timing + "";
            } else {
                var min = parseInt(timing / 60);
                var sec = timing % 60;
                
                return min + " " + sec + "";
            }
        };
        
        ///
        this.refactorMsgs = function (historyChats) {
            var tmpMsg = null;
            var direction = null;
            var name = null;
            var refactorMsg = [];
            
            historyChats.forEach(function (item, index) {
                tmpMsg = null;
                
                //
                if (item.direction == "1") {
                    direction = "recv";
                    name = item.customId;
                }
                
                //
                if (item.direction == "2") {
                    direction = "send";
                    name = item.agentName;
                }
                
                //item.time = "2017-09-19 15:22:24";
                switch ( item.contentType ) {
                    case "1":  //
                        tmpMsg = {
                            msg: WeixinEmojiExtend.replace(self.checkUrl(item.content)),
                            direction: direction,
                            type: "text",
                            time: item.time,
                            timeMillis: item.timeMillis,
                            name: name,
                            imSessionId: item.imSessionId,
                            contentType: item.contentType
                        };
                        break;
                    case "2":  //
                        tmpMsg = {
                            msg: { "zoom": replaceDownUrlIp(item.content), "original": replaceDownUrlIp(item.content) },
                            direction: direction,
                            type: "image",
                            time: item.time,
                            timeMillis: item.timeMillis,
                            name: name,
                            imSessionId: item.imSessionId,
                            contentType: item.contentType
                        };
                        break;
                    case "3": //
                        tmpMsg = {
                            msg: replaceDownUrlIp(item.content),
                            direction: direction,
                            type: "voice",
                            time: item.time,
                            timeMillis: item.timeMillis,
                            name: name,
                            imSessionId: item.imSessionId,
                            contentType: item.contentType
                        };
                        break;
                    case "4": //
                        tmpMsg = {
                            msg: replaceDownUrlIp(item.content),
                            direction: direction,
                            type: "file",
                            time: item.time,
                            timeMillis: item.timeMillis,
                            name: name,
                            imSessionId: item.imSessionId,
                            contentType: item.contentType
                        };
                        break;
                    case "5": //
                        tmpMsg = {
                            timeMillis: item.timeMillis,
                            imSessionId: item.imSessionId,
                            contentType: item.contentType
                        };
                        break;
                    case "6": //
                        tmpMsg = {
                            msg: item.content,
                            direction: "tip",
                            type: "text",
                            time: item.time,
                            timeMillis: item.timeMillis,
                            name: name,
                            imSessionId: item.imSessionId,
                            contentType: item.contentType
                        };
                        break;
                    case "7": //
                        tmpMsg = {
                            msg: item.content,
                            direction: "tip",
                            type: "text",
                            time: item.time,
                            timeMillis: item.timeMillis,
                            name: name,
                            imSessionId: item.imSessionId,
                            previousImSessionId: item.previousImSessionId,
                            contentType: item.contentType
                        };
                        break;
                    default:
                        break;
                }
                
                if (tmpMsg) {
                    refactorMsg.push(tmpMsg);
                }
            });
            return refactorMsg;
        };
        
